import "./styles.css";
import React, { useEffect, useState } from "react";
import MyComponent from "./component"; // Ensure MyComponent is imported
import axios from 'axios';

export default function App() {
  const [data, setData] = useState([]);
  const [timedata, setTimeData] = useState([]);
  const [count, setCount] = useState("0");
  const [result, setResult] = useState(0); // Define result state variable

  useEffect(() => {
    fetchData(); // Fetch initial data on component mount
  }, []);

  const fetchData = () => {
    // Fetch personnummer data
    axios.get('http://localhost:5000/personuppgifter/personnummer')
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching personnummer data:', error);
      });

    // Fetch time data
    axios.get('http://localhost:5000/time')
      .then((response) => {
        setTimeData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching time data:', error);
      });
  };

  const reset = () => {
    setCount("0");
  };

  const add = (e) => {
    setCount((prevCount) => prevCount + e.target.value);
  };

  const CheckUserData = () => {
    // Example logic for checking user data
    const list = data.map((item) => {
      try {
        return JSON.parse(Object.values(item)[0]); // Assuming data is structured as [{ "jsonString": ... }]
      } catch (error) {
        console.error('Error parsing JSON:', error);
        return null;
      }
    });

    const matchingUser = list.find((item) => item === count.toString());
    if (matchingUser) {
      console.log("User found:", matchingUser);

      const persondata = {
        value1: count,
        value2: count,
        value3: count,
      };

      // Example GET request to /personuppgifter/login with query parameters
      axios.get('http://localhost:5000/personuppgifter/login', { params: persondata })
        .then((response) => {
          console.log("GET request successful:", response.data);

          // Example POST request with response data
          const responseData = response.data;
          if (Array.isArray(responseData)) {
            const firstNames = responseData.map((item) => item.fornamn);
            const lastNames = responseData.map((item) => item.efternamn);

            const postData = {
              value1: count,
              value2: firstNames,
              value3: lastNames,
              value4: Today,
              value5: Today,
              value6: Today,
              value7: Today,
            };

            // Example POST request to /
            axios.post('http://localhost:5000/', postData)
              .then((response) => {
                console.log("POST request successful:", response.data);
              })
              .catch((error) => {
                console.error('Error with POST request:', error);
              });
          } else {
            console.error('Response data is not an array:', responseData);
          }
        })
        .catch((error) => {
          console.error('Error with GET request:', error);
        });
    } else {
      console.log("User not found for count:", count);
    }

    setCount("0");
  };

  const UpdateTimeUserData = () => {
    // Example logic for updating time user data
    const timelist = timedata.map((item) => {
      try {
        return JSON.parse(Object.values(item)[0]); // Assuming timedata is structured as [{ "jsonString": ... }]
      } catch (error) {
        console.error('Error parsing JSON:', error);
        return null;
      }
    });

    const matchingTimeUser = timelist.find((item) => item === count.toString());
    if (matchingTimeUser) {
      console.log("Time user found:", matchingTimeUser);

      const timepersondata = {
        value1: count,
        value2: count,
        value3: count,
      };

      // Example GET request to /time with query parameters
      axios.get('http://localhost:5000/time', { params: timepersondata })
        .then((response) => {
          console.log("GET request for time successful:", response.data);

          // Example PUT request to /timein with updated data
          const responsetimeData = response.data;
          if (Array.isArray(responsetimeData)) {
            const firstNames = responsetimeData.map((item) => item.fornamn);

            const putTimeData = {
              value7: Today,
            };

            // Example PUT request to /timein
            axios.put('http://localhost:5000/timein', putTimeData)
              .then((response) => {
                console.log("PUT request successful:", response.data);
              })
              .catch((error) => {
                console.error('Error with PUT request:', error);
              });
          } else {
            console.error('Response data for time is not an array:', responsetimeData);
          }
        })
        .catch((error) => {
          console.error('Error with GET request for time:', error);
        });
    } else {
      console.log("Time user not found for count:", count);
      CheckUserData(); // Call CheckUserData if time user not found
    }

    setCount("0");
  };

  var d = new Date();
  var datestring = d.getFullYear() + "-" + (d.getMonth()+1)  + "-" + d.getDate();
  var Today = new Date().toLocaleString();
  let date = new Date();
  let formattedDate = new Intl.DateTimeFormat('sv-SV').format(date);

  return (
    <div className="App">
      <div className="boxContainer">
        <h1 className="title">Lummelunda Grill</h1>
        <div className="Calculator">
          <div className="flex">
            <div className="counter">
              <h1>{count === "1" ? result : count}</h1>
            </div>
          </div>
          <div className="flex">
            <div className="buttons btn-style">
              {buttonList}
              <button onClick={reset}>X</button>
              <button value={0} onClick={(e) => add(e)}>0</button>
              <button onClick={UpdateTimeUserData}>OK</button>
            </div>
          </div>
        </div>
        <div className="datablock">
          <section>
            <h2>Personalliggare</h2>
            <h2>{formattedDate}</h2>
            <MyComponent />
          </section>
        </div>
      </div>
      <footer>
        <p>Lummelunda Grill</p>
        <p>Orgnr</p>
      </footer>
    </div>
  );
}
